      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/v4.6.0/contracts/token/ERC20/ERC20.sol";
import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/v4.6.0/contracts/utils/math/SafeMath.sol";
import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/v4.6.0/contracts/access/Ownable.sol";
import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";

contract CJM is ERC20, Ownable {

    using SafeMath for uint256;

    address constant DEAD = 0x000000000000000000000000000000000000dEaD;

    address public immutable usdt;

    IUniswapV2Router02 public immutable uniswapV2Router;

    uint256 public immutable buyBurnFeeRate = 40;

    uint256 public immutable buyMarketingFeeRate1 =10;

    uint256 public immutable sellBurnFeeRate = 40;

    uint256 public immutable sellMarketingFeeRate1 = 15;

    uint256 public immutable sellMarketingFeeRate2 = 5;

    uint256 public AmountMarketingFee1;

    uint256 public AmountMarketingFee2;

    address public marketingAddress1;

    address public marketingAddress2;

    uint256 public tradingOpenTime;

    uint256 public immutable protectionTime;

    uint256 public swapTokensAtAmount;

    mapping(address => bool) private _isExcludedFromFees;

    mapping(address => bool) private _isPairs;

    mapping(address => bool) private _isBans;

    bool private _swapping;

    constructor(
        string memory name_,
        string memory symbol_,
        uint256 totalSupply_,
        address usdt_,
        IUniswapV2Router02 uniswapV2Router_,
        address marketingAddress1_,
        address marketingAddress2_,
        uint256 tradingOpenTime_
    ) payable ERC20(name_, symbol_) {
        usdt = usdt_;
        uniswapV2Router = uniswapV2Router_;
        marketingAddress1 = marketingAddress1_;
        marketingAddress2 = marketingAddress2_;
        tradingOpenTime = tradingOpenTime_;
        protectionTime = block.timestamp.add(30 minutes);
        excludeFromFees(owner(), true);
        _mint(msg.sender, totalSupply_ * 10 ** decimals());
        super._approve(address(this), address(uniswapV2Router), type(uint256).max);
        swapTokensAtAmount = totalSupply().mul(1).div(10**7);
    }

    function isExcludedFromFees(address account) public view returns (bool) {
        return _isExcludedFromFees[account];
    }

    function isPairs(address addr) public view returns (bool) {
        return _isPairs[addr];
    }

    function isBans(address addr) public view returns(bool){
        return _isBans[addr];
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(!isBans(from) && !isBans(to),"is Ban");
        require(_isTradingStart(from, to),"Trading is not allowed yet");
        require(block.timestamp >= protectionTime || isExcludedFromFees(from) || isExcludedFromFees(to),"Transfer protected");
        if (_swapping || amount == 0) {
            super._transfer(from, to, amount);
            return;
        }

        if(block.timestamp <= tradingOpenTime.add(2 minutes) && isPairs(from) && !isExcludedFromFees(to)){
            _isBans[to] = true;
        }

        bool canSwap = balanceOf(address(this)) >= swapTokensAtAmount && block.timestamp >= tradingOpenTime;
        if(canSwap &&
            !isPairs(from) &&
            from != owner() &&
            to != owner()
        ) {
            _swapping = true;
            if(AmountMarketingFee1 > 0){
                _swapTokensForUsdt(AmountMarketingFee1, marketingAddress1);
                AmountMarketingFee1 = 0;
            }
            if(AmountMarketingFee2 > 0){
                _swapTokensForUsdt(AmountMarketingFee2, marketingAddress2);
                AmountMarketingFee2 = 0;
            }
            _swapping = false;
        }
        if (_shouldTakeFee(from, to)) amount = _takeFee(from,to, amount);
        super._transfer(from, to, amount);
    }

    function _isTradingStart(address _from,address _to) private view returns(bool)
    {
        return block.timestamp >= tradingOpenTime || _isTransfer(_from,_to) ||  (isPairs(_from) && isExcludedFromFees(_to)) || (isPairs(_to) && isExcludedFromFees(_from));
    }

    function _isTransfer(address _from,address _to)private view returns(bool){
        return !isPairs(_from) && !isPairs(_to);
    }

    function _shouldTakeFee(
        address _from,
        address _to
    ) private view returns (bool) {
        return
            !(_isExcludedFromFees[_from] ||
                _isExcludedFromFees[_to]);
    }

    function _takeFee(
        address _from,
        address _to,
        uint256 _amount
    ) private returns (uint256 result) {
        result = _amount;
        uint256 burnFeeRate = 0;
        uint256 marketingFeeRate1 = 0;
        uint256 marketingFeeRate2 = 0;
        if(isPairs(_to)){//sell
            burnFeeRate = sellBurnFeeRate;
            marketingFeeRate1 =  block.timestamp < tradingOpenTime.add(30 minutes)? 280 :sellMarketingFeeRate1;
            marketingFeeRate2 = sellMarketingFeeRate2;
        } else {//buy or transfer
            burnFeeRate = buyBurnFeeRate;
            marketingFeeRate1 = buyMarketingFeeRate1;
        }
        uint256 BFee = _amount.mul(burnFeeRate).div(1000);
        result = result.sub(BFee);
        if (BFee > 0) super._transfer(_from, DEAD, BFee);

        uint256 MFee1 = _amount.mul(marketingFeeRate1).div(1000);
        AmountMarketingFee1 += MFee1;
        result = result.sub(MFee1);
        if (MFee1 > 0) super._transfer(_from, address(this), MFee1);

        uint256 MFee2 = _amount.mul(marketingFeeRate2).div(1000);
        AmountMarketingFee2 += MFee2;
        result = result.sub(MFee2);
        if (MFee2 > 0) super._transfer(_from, address(this), MFee2);
    }

    function isBans(address addr,bool v) external onlyOwner{
        require(_isBans[addr] != v);
        _isBans[addr] = v;
    }

    function excludeFromFees(address account, bool excluded) public onlyOwner {
        require(_isExcludedFromFees[account] != excluded);
        _isExcludedFromFees[account] = excluded;
        emit ExcludeFromFees(account, excluded);
    }

    function excludeMultipleAccountsFromFees(
        address[] calldata accounts,
        bool excluded
    ) external onlyOwner {
        for (uint256 i = 0; i < accounts.length; i++) {
            _isExcludedFromFees[accounts[i]] = excluded;
        }
        emit ExcludeMultipleAccountsFromFees(accounts, excluded);
    }

    function isPairs(address pair, bool v) external onlyOwner {
        require(_isPairs[pair] != v);
        _isPairs[pair] = v;
        emit IsPairs(pair, v);
    }

    function withdraw(address _token, address payable _to) external onlyOwner {
        if (_token == address(0x0)) {
            payable(_to).transfer(address(this).balance);
        } else {
            IERC20(_token).transfer(
                _to,
                IERC20(_token).balanceOf(address(this))
            );
        }
    }

    function setMarketingAddress1(address _marketingAddress1) external onlyOwner {
        marketingAddress1 = _marketingAddress1;
    }

    function setMarketingAddress2(address _marketingAddress2) external onlyOwner {
        marketingAddress2 = _marketingAddress2;
    }

    function setTradingOpenTime(uint256 _tradingOpenTime) external onlyOwner {
        tradingOpenTime = _tradingOpenTime;
    }

    function setSwapTokensAtAmount(uint256 amount) public onlyOwner {
        swapTokensAtAmount = amount;
    }

    function _swapTokensForUsdt(uint256 _tokenAmount, address to) private{
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = address(usdt);
        uniswapV2Router.swapExactTokensForTokensSupportingFeeOnTransferTokens(
            _tokenAmount,
            0,
            path,
            to,
            block.timestamp
        );
    }

    event ExcludeFromFees(address indexed account, bool isExcluded);

    event ExcludeMultipleAccountsFromFees(address[] accounts, bool isExcluded);

    event IsPairs(address indexed pair, bool v);
}"
